INSERT INTO `v1_120870c6726d21b25c081fbf26ead8e85fcd559739d6cab4f56e064e24ef8e8b` VALUES (11, "そ、そうだったんですか……？\nクウカは、あんまり歴史とか時事とかに\n詳しくないので、そんなすごい日\nだったなんて知りませんでした……", 0.5, 104511, 23814074, 10, 1, 0, 1, 23814, 0);
