INSERT INTO `v1_120870c6726d21b25c081fbf26ead8e85fcd559739d6cab4f56e064e24ef8e8b` VALUES (11, "本日は、私の誕生日を祝っていただいて\nありがとうございます……\n豪華なケーキまで用意していただいて、\n何かお返しを考えないといけませんね。", 0.5, 103111, 31114071, 10, 1, 0, 1, 31114, 0);
