INSERT INTO `v1_120870c6726d21b25c081fbf26ead8e85fcd559739d6cab4f56e064e24ef8e8b` VALUES (11, "え～、プリンなんて食べたら\nなくなっちゃうよ～？\nアクセサリーとかの方がいいかな？", 0.5, 100611, 31114081, 10, 1, 0, 1, 31114, 0);
