INSERT INTO `v1_120870c6726d21b25c081fbf26ead8e85fcd559739d6cab4f56e064e24ef8e8b` VALUES (11, "ほ、欲しかったボードゲームが\nあるんですけど……いや、でも、\nあれって結構高かったっけ……？\nシノブさんにおねだりするのは……", 0.5, 102211, 31114086, 10, 1, 0, 1, 31114, 0);
